import React from "react";

export default function NovasPesquizas(props){
    return(
        <div className="NovasPesquisas">
            <a href={props.link}>
            <img src={props.imagem} alt={props.titulo}/>
            </a>
            <p>{props.descricao}</p>
        </div>
    )
}


